function D2D_Video(a){this.video=document.createElement("video");this.video.src=a;this.video.loop=false;this.originX=0;this.originY=0;this.alpha=1;}D2D_Video.prototype.draw=function(b){var a=b.getContext();a.save();a.globalAlpha=this.alpha;if(arguments.length==1){a.drawImage(this.video,0-this.originX,0-this.originY);}else{if(arguments.length==3){a.drawImage(this.video,arguments[1]-this.originX,arguments[2]-this.originY);}else{if(arguments.length==5){a.drawImage(this.video,arguments[1]-this.originX,arguments[2]-this.originY,arguments[3],arguments[4]);}else{if(arguments.length==6){a.translate(arguments[1],arguments[2]);a.rotate(arguments[3]);a.scale(arguments[4],arguments[5]);a.drawImage(this.video,0-this.originX,0-this.originY,32,32);}}}}a.restore();};D2D_Video.prototype.setAlpha=function(a){this.alpha=a;};D2D_Video.prototype.getAlpha=function(){return this.alpha;};D2D_Video.prototype.setOrigin=function(b,a){this.originX=b;this.originY=a;};D2D_Video.prototype.getOriginX=function(){return this.originX;};D2D_Video.prototype.getOriginY=function(){return this.originY;};D2D_Video.prototype.getDrawHandle=function(){return this.video;};D2D_Video.prototype.play=function(){this.video.play();};D2D_Video.prototype.pause=function(){this.video.pause();};D2D_Video.prototype.stop=function(){this.video.pause();if(this.video.readyState==4){this.video.currentTime=0;}};D2D_Video.prototype.reload=function(a){this.video.src=a;this.video.load();};D2D_Video.prototype.setVolume=function(a){this.video.volume=a;};D2D_Video.prototype.getVolume=function(){return this.video.volume;};D2D_Video.prototype.isLoop=function(){return this.video.loop;};D2D_Video.prototype.setLoop=function(a){this.video.loop=a;};D2D_Video.prototype.getTotalTime=function(){return this.video.duration;};D2D_Video.prototype.getCurrentTime=function(){return this.video.currentTime;};D2D_Video.prototype.setCurrentTime=function(a){this.video.currentTime=a;};D2D_Video.prototype.getSpeed=function(){return this.video.playbackRate;};D2D_Video.prototype.setSpeed=function(a){this.video.playbackRate=a;};D2D_Video.prototype.isPlaying=function(){return(this.video.paused==false);};D2D_Video.prototype.isReady=function(){return(this.video.readyState==4);};D2D_Video.prototype.getReadyStateCode=function(){return this.video.readyState;};D2D_Video.prototype.getReadyState=function(){if(this.video.readyState==0){return"HAVE_NOTHING";}else{if(this.video.readyState==1){return"HAVE_METADATA";}else{if(this.video.readyState==2){return"HAVE_CURRENT_DATA";}else{if(this.video.readyState==3){return"HAVE_FUTURE_DATA";}else{if(this.video.readyState==4){return"HAVE_ENOUGH_DATA";}else{return"READY_STATE_ERROR";}}}}}};D2D_Video.prototype.dispose=function(){this.video.pause();this.video=null;this.originX=null;this.originY=null;this.alpha=null;};